import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Cards';
import Sdata from './Sdata';

console.log(Sdata[0].sname);



ReactDOM.render(
<>

 <h1>List og Top 5 Netflix in 2021</h1>
 <div className="flexBox">
 <Card  imgsrc={Sdata[0].imgsrc}
title={Sdata[0].title} 
  sname={Sdata[0].sname}
  link={Sdata[0].link}
/>
<Card className="Hitesh" imgsrc={Sdata[1].imgsrc}
title={Sdata[1].title} 
  sname={Sdata[1].sname}
  link={Sdata[1].link} />
<Card imgsrc={Sdata[2].imgsrc}
title={Sdata[2].title} 
  sname={Sdata[2].sname}
  link={Sdata[2].link}/>

<Card  imgsrc={Sdata[0].imgsrc}
title={Sdata[0].title} 
  sname={Sdata[0].sname}
  link={Sdata[0].link}
/>
<Card imgsrc={Sdata[1].imgsrc}
title={Sdata[1].title} 
  sname={Sdata[1].sname}
  link={Sdata[1].link} />

<Card imgsrc={Sdata[1].imgsrc}
title={Sdata[1].title} 
  sname={Sdata[1].sname}
  link={Sdata[1].link} />
<Card imgsrc={Sdata[2].imgsrc}
title={Sdata[2].title} 
  sname={Sdata[2].sname}
  link={Sdata[2].link}/>

<Card  imgsrc={Sdata[0].imgsrc}
title={Sdata[0].title} 
  sname={Sdata[0].sname}
  link={Sdata[0].link}
/>
<Card imgsrc={Sdata[1].imgsrc}
title={Sdata[1].title} 
  sname={Sdata[1].sname}
  link={Sdata[1].link} />


 </div>


</>, document.getElementById('root'))
